-- ----------------------------
--  Function structure for `fnc_gravar_log_envase_bico`
-- ----------------------------
DROP FUNCTION IF EXISTS `fnc_gravar_log_envase_bico`;
delimiter ;;
CREATE DEFINER=`alltronic`@`%` FUNCTION `fnc_gravar_log_envase_bico`(v_ip VARCHAR(20), v_bico INT, v_datahora VARCHAR(20), v_valor_kg double) RETURNS int(11)
    DETERMINISTIC
BEGIN
	INSERT INTO `tb_log_envase_bico` (`leb_mab_id`, `leb_valor`, `leb_datahora`)
    SELECT `mab_id`, v_valor_kg, v_datahora
    FROM tb_maquina_bico
    INNER JOIN tb_maquina ON (`maq_id` = `mab_maq_id`)
    INNER JOIN tb_bico ON (`bic_id` = `mab_bic_id`)
    WHERE `maq_ip` = v_ip
    AND `bic_codigo` = v_bico;
    
    RETURN 1;
END
 ;;
delimiter ;

