	v_ip VARCHAR(20), v_tipo_status INT, v_bit INT, v_datahora datetime, v_valor int
) RETURNS int(11)
    DETERMINISTIC
BEGIN
    INSERT INTO `tb_log_status_maquina` (`lsm_maq_id`, `lsm_sta_id`, `lsm_datahora`, `lsm_valor`)
    SELECT `maq_id`, `sta_id`, v_datahora, v_valor
    FROM `tb_maquina`
    INNER JOIN `tb_status` ON (`sta_tst_id` = v_tipo_status AND `sta_bit` = v_bit)
    WHERE `maq_ip` = v_ip;
    
    RETURN 1;
END
